import React from "react";
import { Redirect, Route, Switch } from "react-router-dom";
import SLUGS from "../resources/slugs";
import Dashboard from "./Dashboard/Dashboard";

function PrivatePages() {
  return (
    <Switch>
      <Route exact path={SLUGS.dashboard} render={() => <div>Dashboard</div>} />
      <Route
        exact
        path={SLUGS.agreements}
        render={() => <div>Agreements</div>}
      />
      <Route 
        exact 
        path={SLUGS.templates} 
        render={() => <div>Templates</div>} />
      <Route 
        exact 
        path={SLUGS.lawyers} 
        render={() => <div>Lawyers</div>} />
      <Route
        exact
        path={SLUGS.supportTickets}
        render={() => <div>Support Tickets</div>}
      />
      <Route
        exact
        path={SLUGS.settings}
        render={() => <div>Settings</div>}
      />
      <Redirect to={SLUGS.dashboard} />
    </Switch>
  );
}

export default PrivatePages;
